import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBars } from "@fortawesome/free-solid-svg-icons";

function App() {
  return (
    <div className="App-header">
      <header className="bg-white shadow px-6">
        <div className="flex justify-between items-center h-16 border-b">
          <button className="text-gray-400 hover:text-blue-600 hover:bg-gray-100 transition-colors rounded p-1 m-1 focus:right-2 focus:ring-slate-100">
            <FontAwesomeIcon icon={faBars} />
          </button>
          <div className="flex items-center space-x-4">
            <NavLink href="/">Home</NavLink>
            <NavLink href="/about">About</NavLink>
            <NavLink href="/blog">Blog</NavLink>
            <NavLink href="/contact">Contact</NavLink>
          </div>
        </div>
      </header>
    </div>
  );
}

// Componente para enlaces de navegación
const NavLink = ({ href, children }) => (
  <a
    href={href}
    className="text-gray-500 hover:text-blue-600 transition-colors"
  >
    {children}
  </a>
);

export default App;
